Jake Carter is assigned to protect a &quot;high-value package,&quot; a beautiful whistleblower trying to expose a corrupt military defense contractor. But a heavily armed team of mercenaries has been hired to kill her, along with anyone who gets in their way, and it's going to take a fearless one-man fighting machine to stop them. 

Director: William Kaufman
Writer: Alan B. McElroy
Stars: Matthew MacCaull, Mike 'The Miz' Mizanin, Melissa Roxburgh 
Genres: Action | Thriller
Country: USA
Language: English

